import React from "react";
import "./Contact.css";

function Contact() {
  return (
    <div className="container my-2">
      <div className="row justify-content-center">
        <div className="col-11 bg-success Contact text-center py-3">
          <p>My Website Pvt.Ltd</p>
          <p>Kanyakumari, Tamil Nadu, India.</p>
          <p>Mobile : +91 962627043</p>
          <p>E-mail: cnmovingforward@.com</p>
        </div>
      </div>
    </div>
  );
}

export default Contact;
